import { link } from "fs";
import React, { useState } from "react";
import "./App.css";
function App() {
  const [todos, setTodos] = useState(["take dogs for walk", "wash car"]);
  const [input, setInput] = useState("");
  const addTodo = event => {
    setTodos([...todos, input]);
  };
  return (
    <div className="App">
      <h1>Hi</h1>
      <form action="">
      <input
        type="text"
        value={input}
        onChange={event => setInput(event.target.value)}
      />
      <button onClick={addTodo}>Add Todo</button></form>

      <ul>
        {todos.map(todo => (
          <li>{todo}</li>
        ))}
      </ul>

      {/* 
      <GlobalStyle />
      <Button>Primary Btn</Button>
      <Button secondary>Secondary Btn</Button>
      <Button disabled>Disabled Btn</Button>
      <Button large>Large Btn</Button> */}
    </div>
  );
}

export default App;
